export default function Logo({ src, ...rest }) {
  return (
    <Link
      path="/"
      sx={{
        variant: 'links.logo',
        display: 'flex',
        cursor: 'pointer',
        mr: 15,
      }}
      {...rest}
    >
      {/* <Image
        width="130"
        height="90"
        src={Logopath}
        alt="startup landing logo"
      /> */}
       <h1>bemboo</h1>
    </Link>
  );
}
